-- First drop any existing tables from the DB. This has to be done in just this order
-- so we do not violate our foreign key constraints

DROP TABLE IF EXISTS `ImageOwner` ;
DROP TABLE IF EXISTS `Image` ;
DROP TABLE IF EXISTS `Friend` ;
DROP TABLE IF EXISTS `Message` ;
DROP TABLE IF EXISTS `User` ;

-- -----------------------------------------------------
-- Table `User`
-- -----------------------------------------------------

CREATE  TABLE IF NOT EXISTS `User` (
  `idUser` INT NOT NULL AUTO_INCREMENT ,
  `GivenName` VARCHAR(60) NULL ,
  `Surname` VARCHAR(60) NULL ,
  `Address` VARCHAR(255) NULL ,
  `City` VARCHAR(45) NULL ,
  `Country` VARCHAR(45) NULL ,
  `DateOfBirth` DATETIME NULL ,
  `Email` VARCHAR(80) NULL ,
  PRIMARY KEY (`idUser`) ,
  INDEX `Surname` (`Surname` ASC) ,
  INDEX `GivenName` (`GivenName` ASC) ,
  INDEX `Name` (`GivenName` ASC, `Surname` ASC) ,
  INDEX `City` (`City` ASC) ,
  INDEX `DateOfBirth` (`DateOfBirth` ASC) ,
  INDEX `Email` (`Email` ASC) )
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `Friend`
-- -----------------------------------------------------

CREATE  TABLE IF NOT EXISTS `Friend` (
  `idFriend` INT NOT NULL AUTO_INCREMENT ,
  `idUser1` INT NOT NULL ,
  `idUser2` INT NOT NULL ,
  PRIMARY KEY (`idFriend`) ,
  INDEX `FriendUser1` (`idUser1` ASC) ,
  INDEX `FriendUser2` (`idUser2` ASC) ,
  CONSTRAINT `FriendUser1`
    FOREIGN KEY (`idUser1` )
    REFERENCES `User` (`idUser` )
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `FriendUser2`
    FOREIGN KEY (`idUser2` )
    REFERENCES `User` (`idUser` )
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `Message`
-- -----------------------------------------------------

CREATE  TABLE IF NOT EXISTS `Message` (
  `idMessage` INT NOT NULL AUTO_INCREMENT ,
  `idOwner` INT NULL ,
  `Subject` VARCHAR(255) NULL ,
  `Body` TEXT NULL ,
  `Posted` DATETIME NULL ,
  `isPublic` TINYINT(1) NULL DEFAULT false ,
  PRIMARY KEY (`idMessage`) ,
  INDEX `MessageOwner` (`idOwner` ASC) ,
  CONSTRAINT `MessageOwner`
    FOREIGN KEY (`idOwner` )
    REFERENCES `User` (`idUser` )
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `Image`
-- -----------------------------------------------------

CREATE  TABLE IF NOT EXISTS `Image` (
  `idImage` INT NOT NULL AUTO_INCREMENT ,
  `Caption` VARCHAR(255) NULL ,
  `ImageData` BLOB NULL ,
  `isPublic` TINYINT(1) NULL ,
  PRIMARY KEY (`idImage`) )
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `ImageOwner`
-- -----------------------------------------------------

CREATE  TABLE IF NOT EXISTS `ImageOwner` (
  `idImageOwner` INT NOT NULL AUTO_INCREMENT ,
  `idImage` INT NULL ,
  `idOwner` INT NULL ,
  PRIMARY KEY (`idImageOwner`) ,
  INDEX `Image` (`idImage` ASC) ,
  INDEX `ImageOwner` (`idOwner` ASC) ,
  CONSTRAINT `Image`
    FOREIGN KEY (`idImage` )
    REFERENCES `Image` (`idImage` )
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `ImageOwner`
    FOREIGN KEY (`idOwner` )
    REFERENCES `User` (`idUser` )
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

